INSERT INTO public.career_recommendations (id, student_id, career_title, career_id, match_percentage, description, salary_min, salary_max, salary_currency, salary_unit, growth_indicator, growth_type, skills, based_on_assessment_id, created_at, generated_from_profile, generated_from_assessment, ai_provider, prompt_version) VALUES (8, 'cmk1eceoy0005afglm5gv6e6v', 'Embedded Systems Engineer', 'career-1767707107363-y1ntlylsf', 38, 'With a foundation in ECE, a career in embedded systems could be suitable, involving the design and development of software and hardware for non-computer devices. The match is based on the educational alignment and potential aptitudes typical for ECE students.', 5.50, 16.00, '', 'LPA', 'High', 'High', '{"C Programming",RTOS,"Microprocessor Architecture"}', 5, '2026-01-06 13:45:07.369', NULL, NULL, 'groq', '1.0');
