INSERT INTO public.career_recommendations (id, student_id, career_title, career_id, match_percentage, description, salary_min, salary_max, salary_currency, salary_unit, growth_indicator, growth_type, skills, based_on_assessment_id, created_at, generated_from_profile, generated_from_assessment, ai_provider, prompt_version) VALUES (11, 'cmk1eceoy0005afglm5gv6e6v', 'Research and Development Engineer', 'career-1767707107480-hhhmboaim', 32, 'For those with a strong educational foundation in ECE, roles in R&D can be appealing, focusing on the development of new technologies and products. While specific interests or aptitudes are not known, the ECE background provides a broad base for such roles.', 7.00, 20.00, '', 'LPA', 'High', 'High', '{"Innovation Management","Project Planning","Technical Writing"}', 5, '2026-01-06 13:45:07.486', NULL, NULL, 'groq', '1.0');
