INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (1, 7, 'What is the primary purpose of the ''final'' keyword in Java?', '["To make a variable constant", "To prevent method overriding", "To prevent class inheritance", "All of the above"]', 3, 'conceptual', 'BEGINNER', 'The ''final'' keyword can be used for variables (constants), methods (prevent overriding), and classes (prevent inheritance).', 1, '2026-01-06 18:29:57.263', '2026-01-06 18:29:57.263');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (2, 7, 'What is the difference between == and .equals() in Java?', '["== compares references, .equals() compares values", ".equals() compares references, == compares values", "They are identical", "== only works for primitives"]', 0, 'conceptual', 'BEGINNER', '== compares object references (memory addresses), while .equals() compares the actual content/values of objects.', 1, '2026-01-06 18:29:57.263', '2026-01-06 18:29:57.263');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (3, 7, 'What is the default value of an int variable in Java?', '["0", "null", "undefined", "1"]', 0, 'conceptual', 'BEGINNER', 'Primitive types in Java have default values. int defaults to 0.', 1, '2026-01-06 18:29:57.263', '2026-01-06 18:29:57.263');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (4, 7, 'Which collection class is synchronized in Java?', '["ArrayList", "Vector", "LinkedList", "HashSet"]', 1, 'conceptual', 'BEGINNER', 'Vector is synchronized (thread-safe), while ArrayList, LinkedList, and HashSet are not.', 1, '2026-01-06 18:29:57.263', '2026-01-06 18:29:57.263');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (5, 7, 'What is the superclass of all classes in Java?', '["Object", "Class", "Super", "Parent"]', 0, 'conceptual', 'BEGINNER', 'Object is the root class of the Java class hierarchy. All classes inherit from Object.', 1, '2026-01-06 18:29:57.263', '2026-01-06 18:29:57.263');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (6, 7, 'Write a Java method to check if a number is even.', '["public boolean isEven(int n) { return n % 2 == 0; }", "public boolean isEven(int n) { return n / 2 == 0; }", "public boolean isEven(int n) { return n * 2 == 0; }", "public boolean isEven(int n) { return n - 2 == 0; }"]', 0, 'practical', 'BEGINNER', 'The modulo operator (%) returns the remainder. If n % 2 == 0, the number is even.', 1, '2026-01-06 18:29:57.263', '2026-01-06 18:29:57.263');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (7, 7, 'What is an interface in Java?', '["A class that cannot be instantiated", "A contract that defines methods a class must implement", "A data structure", "A variable type"]', 1, 'conceptual', 'BEGINNER', 'An interface defines a contract - it specifies methods that implementing classes must provide.', 1, '2026-01-06 18:29:57.263', '2026-01-06 18:29:57.263');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (8, 7, 'You need to store unique elements. Which collection should you use?', '["ArrayList", "HashSet", "LinkedList", "Array"]', 1, 'scenario', 'BEGINNER', 'HashSet automatically ensures uniqueness of elements, which is perfect for this requirement.', 1, '2026-01-06 18:29:57.263', '2026-01-06 18:29:57.263');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (9, 7, 'What is the difference between ArrayList and LinkedList in Java?', '["ArrayList is faster for random access, LinkedList is faster for insertions/deletions", "LinkedList is faster for random access, ArrayList is faster for insertions/deletions", "They are identical in performance", "ArrayList can only store primitives"]', 0, 'conceptual', 'INTERMEDIATE', 'ArrayList uses dynamic arrays (O(1) access, O(n) insert/delete), while LinkedList uses nodes (O(n) access, O(1) insert/delete).', 1, '2026-01-06 18:29:57.263', '2026-01-06 18:29:57.263');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (10, 7, 'Write a Java method to reverse a string without using StringBuilder.', '["public String reverse(String str) { return new StringBuilder(str).reverse().toString(); }", "public String reverse(String str) { char[] chars = str.toCharArray(); for(int i=0, j=chars.length-1; i<j; i++, j--) { char temp = chars[i]; chars[i] = chars[j]; chars[j] = temp; } return new String(chars); }", "public String reverse(String str) { return str.split('''').reverse().join(''''); }", "public String reverse(String str) { return str.reverse(); }"]', 1, 'practical', 'INTERMEDIATE', 'The correct solution uses a two-pointer approach to swap characters in a char array without using StringBuilder.', 1, '2026-01-06 18:29:57.263', '2026-01-06 18:29:57.263');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (11, 7, 'What is method overloading in Java?', '["Having multiple methods with the same name but different parameters", "Having multiple methods with different names", "Inheriting methods from a parent class", "Overriding a method from a parent class"]', 0, 'conceptual', 'INTERMEDIATE', 'Method overloading allows multiple methods with the same name but different parameter lists (different types or number of parameters).', 1, '2026-01-06 18:29:57.263', '2026-01-06 18:29:57.263');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (12, 7, 'What is the difference between checked and unchecked exceptions?', '["Checked exceptions must be handled, unchecked don''t", "Unchecked exceptions must be handled, checked don''t", "They are the same", "Checked exceptions are for errors only"]', 0, 'conceptual', 'INTERMEDIATE', 'Checked exceptions (like IOException) must be declared or caught, while unchecked exceptions (like RuntimeException) don''t require handling.', 1, '2026-01-06 18:29:57.263', '2026-01-06 18:29:57.263');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (13, 7, 'Write a Java method to find the maximum value in an array.', '["public int findMax(int[] arr) { int max = arr[0]; for(int i=1; i<arr.length; i++) { if(arr[i] > max) max = arr[i]; } return max; }", "public int findMax(int[] arr) { return arr[arr.length-1]; }", "public int findMax(int[] arr) { return arr[0]; }", "public int findMax(int[] arr) { return arr.length; }"]', 0, 'practical', 'INTERMEDIATE', 'The correct solution iterates through the array, comparing each element with the current maximum.', 1, '2026-01-06 18:29:57.263', '2026-01-06 18:29:57.263');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (14, 7, 'What is the purpose of the ''static'' keyword in Java?', '["To make a variable constant", "To make a method or variable belong to the class rather than instances", "To prevent inheritance", "To make a class final"]', 1, 'conceptual', 'INTERMEDIATE', 'Static members belong to the class itself, not to instances. They can be accessed without creating an object.', 1, '2026-01-06 18:29:57.263', '2026-01-06 18:29:57.263');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (15, 7, 'You are building a caching system. Which collection would be best for key-value pairs with fast lookup?', '["ArrayList", "HashMap", "LinkedList", "HashSet"]', 1, 'scenario', 'INTERMEDIATE', 'HashMap provides O(1) average-case lookup time for key-value pairs, making it ideal for caching.', 1, '2026-01-06 18:29:57.263', '2026-01-06 18:29:57.263');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (16, 7, 'What is the time complexity of searching in a HashMap?', '["O(n)", "O(log n)", "O(1) average case", "O(n log n)"]', 2, 'conceptual', 'INTERMEDIATE', 'HashMap provides O(1) average-case time complexity for search operations, though worst case can be O(n).', 1, '2026-01-06 18:29:57.263', '2026-01-06 18:29:57.263');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (17, 7, 'You are building a multi-threaded application. How would you ensure thread safety when multiple threads access a shared counter?', '["Use synchronized keyword on the increment method", "Use AtomicInteger class", "Use volatile keyword on the counter variable", "Both A and B are correct"]', 3, 'scenario', 'ADVANCED', 'Both synchronized methods and AtomicInteger provide thread safety. AtomicInteger is more efficient for simple operations.', 1, '2026-01-06 18:29:57.263', '2026-01-06 18:29:57.263');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (18, 7, 'What is the difference between String, StringBuffer, and StringBuilder?', '["String is immutable, StringBuffer is mutable and synchronized, StringBuilder is mutable and not synchronized", "They are all identical", "StringBuffer is immutable, StringBuilder is mutable", "String is mutable, others are immutable"]', 0, 'conceptual', 'ADVANCED', 'String is immutable. StringBuffer is mutable and thread-safe (synchronized). StringBuilder is mutable but not thread-safe (faster).', 1, '2026-01-06 18:29:57.263', '2026-01-06 18:29:57.263');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (38, 8, 'Write a Python decorator that measures the execution time of a function.', '["import time; def timer(func): def wrapper(*args, **kwargs): start = time.time(); result = func(*args, **kwargs); print(f''Time: {time.time() - start}''); return result; return wrapper", "def timer(func): return func", "def timer(func): return func()", "def timer(func): print(''timer'')"]', 0, 'practical', 'ADVANCED', 'The decorator wraps the function, records start time, executes the function, and prints the elapsed time.', 1, '2026-01-06 18:29:57.283', '2026-01-06 18:29:57.283');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (19, 7, 'Write a Java method to implement a binary search algorithm.', '["public int binarySearch(int[] arr, int target) { int left = 0, right = arr.length - 1; while(left <= right) { int mid = left + (right - left) / 2; if(arr[mid] == target) return mid; if(arr[mid] < target) left = mid + 1; else right = mid - 1; } return -1; }", "public int binarySearch(int[] arr, int target) { for(int i=0; i<arr.length; i++) { if(arr[i] == target) return i; } return -1; }", "public int binarySearch(int[] arr, int target) { return arr[target]; }", "public int binarySearch(int[] arr, int target) { return arr.length; }"]', 0, 'practical', 'ADVANCED', 'Binary search requires a sorted array and uses divide-and-conquer to find the target in O(log n) time.', 1, '2026-01-06 18:29:57.263', '2026-01-06 18:29:57.263');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (20, 7, 'You need to design a system that processes tasks asynchronously. Which Java concurrency utility would be best?', '["Thread class", "ExecutorService", "synchronized keyword", "volatile keyword"]', 1, 'scenario', 'ADVANCED', 'ExecutorService provides a high-level API for managing thread pools and asynchronous task execution, which is ideal for this use case.', 1, '2026-01-06 18:29:57.263', '2026-01-06 18:29:57.263');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (21, 8, 'What is the difference between a list and a tuple in Python?', '["Lists are mutable, tuples are immutable", "Tuples are mutable, lists are immutable", "They are identical", "Lists can only store numbers"]', 0, 'conceptual', 'BEGINNER', 'Lists can be modified after creation (mutable), while tuples cannot (immutable).', 1, '2026-01-06 18:29:57.283', '2026-01-06 18:29:57.283');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (22, 8, 'What does the ''with'' statement do in Python?', '["It creates a new variable scope", "It ensures proper resource management and automatic cleanup", "It is used for loops", "It imports modules"]', 1, 'conceptual', 'BEGINNER', 'The ''with'' statement provides automatic resource management, ensuring cleanup even if exceptions occur.', 1, '2026-01-06 18:29:57.283', '2026-01-06 18:29:57.283');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (23, 8, 'How do you create an empty dictionary in Python?', '["{}", "dict()", "Both A and B", "[]"]', 2, 'conceptual', 'BEGINNER', 'Both {} and dict() create empty dictionaries in Python.', 1, '2026-01-06 18:29:57.283', '2026-01-06 18:29:57.283');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (24, 8, 'What is a list comprehension in Python?', '["A way to create lists using a concise syntax", "A method to sort lists", "A way to delete list elements", "A type of loop"]', 0, 'conceptual', 'BEGINNER', 'List comprehensions provide a concise way to create lists based on existing iterables.', 1, '2026-01-06 18:29:57.283', '2026-01-06 18:29:57.283');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (25, 8, 'Write a Python function to find the factorial of a number using recursion.', '["def factorial(n): return n * factorial(n-1) if n > 1 else 1", "def factorial(n): return n * factorial(n-1)", "def factorial(n): return factorial(n) * factorial(n-1)", "def factorial(n): return n * (n-1)"]', 0, 'practical', 'BEGINNER', 'The correct recursive function includes a base case (n <= 1 returns 1) to prevent infinite recursion.', 1, '2026-01-06 18:29:57.283', '2026-01-06 18:29:57.283');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (26, 8, 'What is the difference between ''is'' and ''=='' in Python?', '["''is'' checks identity (same object), ''=='' checks equality (same value)", "''=='' checks identity, ''is'' checks equality", "They are identical", "''is'' only works for numbers"]', 0, 'conceptual', 'BEGINNER', '''is'' checks if two variables refer to the same object (identity), while ''=='' checks if values are equal.', 1, '2026-01-06 18:29:57.283', '2026-01-06 18:29:57.283');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (27, 8, 'You need to remove duplicates from a list. What''s the best approach?', '["Use a set: list(set(my_list))", "Use a loop to check each element", "Use the remove() method", "Use the pop() method"]', 0, 'scenario', 'BEGINNER', 'Converting to a set removes duplicates automatically, then converting back to a list gives unique elements.', 1, '2026-01-06 18:29:57.283', '2026-01-06 18:29:57.283');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (28, 8, 'What is a Python decorator?', '["A function that modifies another function", "A variable type", "A data structure", "A loop construct"]', 0, 'conceptual', 'BEGINNER', 'A decorator is a function that takes another function and extends its behavior without modifying it explicitly.', 1, '2026-01-06 18:29:57.283', '2026-01-06 18:29:57.283');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (29, 8, 'What is the difference between __str__ and __repr__ in Python?', '["__str__ is for end users, __repr__ is for developers (should be unambiguous)", "__repr__ is for end users, __str__ is for developers", "They are identical", "__str__ only works for strings"]', 0, 'conceptual', 'INTERMEDIATE', '__str__ returns a human-readable string, while __repr__ should return an unambiguous representation for developers.', 1, '2026-01-06 18:29:57.283', '2026-01-06 18:29:57.283');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (30, 8, 'Write a Python function to flatten a nested list.', '["def flatten(lst): return [item for sublist in lst for item in sublist]", "def flatten(lst): return lst.flat()", "def flatten(lst): return lst.flatten()", "def flatten(lst): return list(set(lst))"]', 0, 'practical', 'INTERMEDIATE', 'The list comprehension iterates through each sublist and then each item, creating a flat list.', 1, '2026-01-06 18:29:57.283', '2026-01-06 18:29:57.283');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (31, 8, 'What is a generator in Python?', '["A function that returns an iterator using yield", "A type of list", "A way to create classes", "A built-in function"]', 0, 'conceptual', 'INTERMEDIATE', 'A generator is a function that uses ''yield'' to produce values one at a time, making it memory efficient.', 1, '2026-01-06 18:29:57.283', '2026-01-06 18:29:57.283');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (32, 8, 'What is the Global Interpreter Lock (GIL) in Python?', '["A mechanism that allows only one thread to execute Python bytecode at a time", "A way to lock global variables", "A type of data structure", "A debugging tool"]', 0, 'conceptual', 'INTERMEDIATE', 'The GIL is a mutex that prevents multiple native threads from executing Python bytecodes simultaneously.', 1, '2026-01-06 18:29:57.283', '2026-01-06 18:29:57.283');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (33, 8, 'Write a Python function to find the first duplicate in a list.', '["def find_duplicate(lst): seen = set(); for item in lst: if item in seen: return item; seen.add(item); return None", "def find_duplicate(lst): return lst[0]", "def find_duplicate(lst): return len(lst)", "def find_duplicate(lst): return set(lst)"]', 0, 'practical', 'INTERMEDIATE', 'Using a set to track seen items allows O(1) lookup to find the first duplicate efficiently.', 1, '2026-01-06 18:29:57.283', '2026-01-06 18:29:57.283');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (34, 8, 'What is the difference between *args and **kwargs in Python?', '["*args is for positional arguments, **kwargs is for keyword arguments", "**kwargs is for positional arguments, *args is for keyword arguments", "They are identical", "*args only works for lists"]', 0, 'conceptual', 'INTERMEDIATE', '*args collects positional arguments into a tuple, while **kwargs collects keyword arguments into a dictionary.', 1, '2026-01-06 18:29:57.283', '2026-01-06 18:29:57.283');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (35, 8, 'You need to process a large file line by line without loading it all into memory. What''s the best approach?', '["Use a for loop with open(): for line in open(''file.txt''):", "Use readlines() to load all lines", "Use read() to load entire file", "Use pickle to load the file"]', 0, 'scenario', 'INTERMEDIATE', 'Iterating over a file object reads one line at a time, making it memory efficient for large files.', 1, '2026-01-06 18:29:57.283', '2026-01-06 18:29:57.283');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (36, 8, 'What is the time complexity of searching in a Python dictionary?', '["O(n)", "O(log n)", "O(1) average case", "O(n log n)"]', 2, 'conceptual', 'INTERMEDIATE', 'Python dictionaries use hash tables, providing O(1) average-case lookup time.', 1, '2026-01-06 18:29:57.283', '2026-01-06 18:29:57.283');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (37, 8, 'What is a context manager in Python and how do you create one?', '["An object that implements __enter__ and __exit__ methods", "A type of function", "A data structure", "A built-in class"]', 0, 'conceptual', 'ADVANCED', 'Context managers implement the context manager protocol with __enter__ and __exit__ methods, used with ''with'' statements.', 1, '2026-01-06 18:29:57.283', '2026-01-06 18:29:57.283');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (39, 8, 'You need to implement a thread-safe counter in Python. What''s the best approach?', '["Use threading.Lock() to synchronize access", "Use a regular variable", "Use a list", "Use a set"]', 0, 'scenario', 'ADVANCED', 'Using a Lock ensures that only one thread can modify the counter at a time, preventing race conditions.', 1, '2026-01-06 18:29:57.283', '2026-01-06 18:29:57.283');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (40, 8, 'What is the difference between __new__ and __init__ in Python?', '["__new__ creates the instance, __init__ initializes it", "__init__ creates the instance, __new__ initializes it", "They are identical", "__new__ only works for classes"]', 0, 'conceptual', 'ADVANCED', '__new__ is called to create a new instance (constructor), while __init__ is called to initialize the instance.', 1, '2026-01-06 18:29:57.283', '2026-01-06 18:29:57.283');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (141, 6, 'What is the difference between ''let'', ''const'', and ''var'' in JavaScript?', '["''let'' and ''const'' are block-scoped, ''var'' is function-scoped", "''var'' is block-scoped, ''let'' and ''const'' are function-scoped", "They are all identical", "''const'' is mutable, ''let'' is immutable"]', 0, 'conceptual', 'BEGINNER', '''let'' and ''const'' are block-scoped (ES6+), while ''var'' is function-scoped. ''const'' is also immutable.', 1, '2026-01-06 18:29:57.344', '2026-01-06 18:29:57.344');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (142, 6, 'What is a closure in JavaScript?', '["A function that has access to variables in its outer scope", "A way to close a function", "A type of loop", "A data structure"]', 0, 'conceptual', 'BEGINNER', 'A closure is a function that retains access to variables from its outer (enclosing) scope even after the outer function has returned.', 1, '2026-01-06 18:29:57.344', '2026-01-06 18:29:57.344');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (143, 6, 'What is the difference between ''null'' and ''undefined'' in JavaScript?', '["''null'' represents the absence of a value, ''undefined'' represents an uninitialized variable", "''undefined'' represents the absence of a value, ''null'' represents an uninitialized variable", "They are identical", "''null'' is a primitive, ''undefined'' is an object"]', 0, 'conceptual', 'BEGINNER', '''null'' is an assigned value meaning ''no value'', while ''undefined'' means a variable has been declared but not assigned.', 1, '2026-01-06 18:29:57.344', '2026-01-06 18:29:57.344');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (144, 6, 'Write a JavaScript function to check if a string is a palindrome.', '["function isPalindrome(str) { return str === str.split('''').reverse().join(''''); }", "function isPalindrome(str) { return str === str.split('''').sort().join(''''); }", "function isPalindrome(str) { return str.length > 0; }", "function isPalindrome(str) { return str === str; }"]', 0, 'practical', 'BEGINNER', 'The function splits the string into an array, reverses it, joins it back, and compares with the original.', 1, '2026-01-06 18:29:57.344', '2026-01-06 18:29:57.344');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (145, 6, 'What is the ''this'' keyword in JavaScript?', '["It refers to the current execution context", "It refers to the global object", "It is a variable name", "It refers to the parent function"]', 0, 'conceptual', 'BEGINNER', '''this'' refers to the object that is executing the current function. Its value depends on how the function is called.', 1, '2026-01-06 18:29:57.344', '2026-01-06 18:29:57.344');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (146, 6, 'What is the difference between ''=='' and ''==='' in JavaScript?', '["''=='' checks value equality, ''==='' checks value and type equality", "''==='' checks value equality, ''=='' checks value and type equality", "They are identical", "''=='' only works for numbers"]', 0, 'conceptual', 'BEGINNER', '''=='' performs type coercion before comparison, while ''==='' checks both value and type without coercion.', 1, '2026-01-06 18:29:57.344', '2026-01-06 18:29:57.344');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (147, 6, 'You need to add an element to the end of an array. What method should you use?', '["push()", "pop()", "shift()", "unshift()"]', 0, 'scenario', 'BEGINNER', 'push() adds one or more elements to the end of an array and returns the new length.', 1, '2026-01-06 18:29:57.344', '2026-01-06 18:29:57.344');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (148, 6, 'What is an arrow function in JavaScript?', '["A shorter syntax for writing functions with lexical ''this'' binding", "A type of loop", "A data structure", "A way to import modules"]', 0, 'conceptual', 'BEGINNER', 'Arrow functions provide a concise syntax and automatically bind ''this'' to the enclosing scope.', 1, '2026-01-06 18:29:57.344', '2026-01-06 18:29:57.344');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (149, 6, 'What is the purpose of ''async/await'' in JavaScript?', '["To handle asynchronous operations in a synchronous-like manner", "To make synchronous code asynchronous", "To handle errors", "To import modules"]', 0, 'conceptual', 'INTERMEDIATE', 'async/await allows writing asynchronous code that looks and behaves like synchronous code, making it easier to read and maintain.', 1, '2026-01-06 18:29:57.344', '2026-01-06 18:29:57.344');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (150, 6, 'Write a JavaScript function to debounce another function.', '["function debounce(func, delay) { let timeout; return function(...args) { clearTimeout(timeout); timeout = setTimeout(() => func(...args), delay); }; }", "function debounce(func, delay) { return func; }", "function debounce(func, delay) { return delay; }", "function debounce(func, delay) { return function() { func(); }; }"]', 0, 'practical', 'INTERMEDIATE', 'Debounce delays function execution until after a specified time has passed since the last invocation.', 1, '2026-01-06 18:29:57.344', '2026-01-06 18:29:57.344');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (151, 6, 'What is the Event Loop in JavaScript?', '["A mechanism that handles asynchronous operations and manages the call stack", "A type of loop", "A data structure", "A way to handle errors"]', 0, 'conceptual', 'INTERMEDIATE', 'The Event Loop continuously checks the call stack and callback queue, moving callbacks to the stack when it''s empty.', 1, '2026-01-06 18:29:57.344', '2026-01-06 18:29:57.344');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (152, 6, 'What is a Promise in JavaScript?', '["An object representing the eventual completion or failure of an asynchronous operation", "A type of function", "A data structure", "A way to declare variables"]', 0, 'conceptual', 'INTERMEDIATE', 'A Promise is an object that represents a value that may not be available yet, but will be resolved or rejected in the future.', 1, '2026-01-06 18:29:57.344', '2026-01-06 18:29:57.344');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (153, 6, 'Write a JavaScript function to flatten a nested array.', '["function flatten(arr) { return arr.reduce((acc, val) => acc.concat(Array.isArray(val) ? flatten(val) : val), []); }", "function flatten(arr) { return arr; }", "function flatten(arr) { return arr.length; }", "function flatten(arr) { return arr[0]; }"]', 0, 'practical', 'INTERMEDIATE', 'The function uses reduce and recursion to flatten nested arrays of any depth.', 1, '2026-01-06 18:29:57.344', '2026-01-06 18:29:57.344');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (154, 6, 'What is the difference between ''map'', ''filter'', and ''reduce'' in JavaScript?', '["''map'' transforms elements, ''filter'' selects elements, ''reduce'' accumulates to a single value", "They are identical", "''filter'' transforms, ''map'' selects, ''reduce'' filters", "''reduce'' transforms, ''map'' filters, ''filter'' reduces"]', 0, 'conceptual', 'INTERMEDIATE', 'map() creates a new array with transformed elements, filter() creates a new array with selected elements, reduce() accumulates to a single value.', 1, '2026-01-06 18:29:57.344', '2026-01-06 18:29:57.344');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (155, 6, 'You need to make an API call and handle the response. What''s the best modern approach?', '["Use fetch() with async/await", "Use XMLHttpRequest", "Use jQuery.ajax()", "Use document.write()"]', 0, 'scenario', 'INTERMEDIATE', 'fetch() with async/await is the modern, promise-based approach for making HTTP requests in JavaScript.', 1, '2026-01-06 18:29:57.344', '2026-01-06 18:29:57.344');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (156, 6, 'What is hoisting in JavaScript?', '["The behavior of moving declarations to the top of their scope", "A way to lift variables", "A type of function", "A data structure"]', 0, 'conceptual', 'INTERMEDIATE', 'Hoisting is JavaScript''s behavior of moving variable and function declarations to the top of their containing scope during compilation.', 1, '2026-01-06 18:29:57.344', '2026-01-06 18:29:57.344');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (157, 6, 'What is the difference between ''call'', ''apply'', and ''bind'' in JavaScript?', '["''call'' and ''apply'' invoke immediately with different argument formats, ''bind'' returns a new function", "They are identical", "''bind'' invokes immediately, ''call'' and ''apply'' return functions", "''apply'' only works for arrays"]', 0, 'conceptual', 'ADVANCED', '''call'' takes arguments individually, ''apply'' takes an array of arguments, both invoke immediately. ''bind'' returns a new function with bound context.', 1, '2026-01-06 18:29:57.344', '2026-01-06 18:29:57.344');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (158, 6, 'Write a JavaScript function to implement a simple memoization cache.', '["function memoize(func) { const cache = {}; return function(...args) { const key = JSON.stringify(args); if(cache[key]) return cache[key]; const result = func(...args); cache[key] = result; return result; }; }", "function memoize(func) { return func; }", "function memoize(func) { return function() { return func(); }; }", "function memoize(func) { return cache; }"]', 0, 'practical', 'ADVANCED', 'Memoization caches function results based on input arguments, avoiding redundant calculations.', 1, '2026-01-06 18:29:57.344', '2026-01-06 18:29:57.344');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (159, 6, 'You need to handle multiple asynchronous operations that must complete in order. What''s the best approach?', '["Use async/await with sequential await calls", "Use Promise.all()", "Use setTimeout()", "Use a for loop"]', 0, 'scenario', 'ADVANCED', 'Sequential await calls ensure operations complete in order, while Promise.all() runs them in parallel.', 1, '2026-01-06 18:29:57.344', '2026-01-06 18:29:57.344');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (160, 6, 'What is a Proxy in JavaScript?', '["An object that wraps another object and intercepts operations", "A type of function", "A way to make HTTP requests", "A data structure"]', 0, 'conceptual', 'ADVANCED', 'A Proxy object allows you to create a wrapper for another object and intercept operations like property access, assignment, etc.', 1, '2026-01-06 18:29:57.344', '2026-01-06 18:29:57.344');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (201, 13, 'What is React?', '["A JavaScript library for building user interfaces", "A database management system", "A CSS framework", "A server-side framework"]', 0, 'conceptual', 'BEGINNER', 'React is a JavaScript library developed by Facebook for building user interfaces, particularly web applications.', 1, '2026-01-06 18:51:10.219', '2026-01-06 18:51:10.219');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (202, 13, 'What is a React component?', '["A reusable piece of code that returns JSX", "A database table", "A CSS class", "A JavaScript function that cannot return anything"]', 0, 'conceptual', 'BEGINNER', 'A React component is a reusable piece of code that encapsulates UI logic and returns JSX to render.', 1, '2026-01-06 18:51:10.219', '2026-01-06 18:51:10.219');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (203, 13, 'What is JSX?', '["A syntax extension that allows writing HTML-like code in JavaScript", "A database query language", "A CSS preprocessor", "A package manager"]', 0, 'conceptual', 'BEGINNER', 'JSX (JavaScript XML) is a syntax extension that allows you to write HTML-like code in JavaScript.', 1, '2026-01-06 18:51:10.219', '2026-01-06 18:51:10.219');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (204, 13, 'What is the purpose of props in React?', '["To pass data from parent to child components", "To store component state", "To handle events", "To import modules"]', 0, 'conceptual', 'BEGINNER', 'Props (properties) are used to pass data from parent components to child components in React.', 1, '2026-01-06 18:51:10.219', '2026-01-06 18:51:10.219');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (205, 13, 'What is state in React?', '["Data that can change over time and triggers re-renders", "A static configuration object", "A CSS property", "A database connection"]', 0, 'conceptual', 'BEGINNER', 'State is data that can change over time. When state changes, React re-renders the component.', 1, '2026-01-06 18:51:10.219', '2026-01-06 18:51:10.219');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (206, 13, 'Write a basic React functional component that displays ''Hello World''.', '["function Hello() { return <h1>Hello World</h1>; }", "function Hello() { return ''Hello World''; }", "function Hello() { console.log(''Hello World''); }", "const Hello = ''Hello World'';"]', 0, 'practical', 'BEGINNER', 'A React functional component must return JSX. The correct syntax returns an h1 element with the text.', 1, '2026-01-06 18:51:10.219', '2026-01-06 18:51:10.219');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (207, 13, 'You need to update a component when a user clicks a button. What should you use?', '["useState hook and onClick event handler", "props", "import statement", "CSS classes"]', 0, 'scenario', 'BEGINNER', 'To update a component on user interaction, you need useState to manage state and onClick to handle the click event.', 1, '2026-01-06 18:51:10.219', '2026-01-06 18:51:10.219');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (208, 13, 'What does React use to optimize rendering?', '["Virtual DOM", "Real DOM directly", "CSS animations", "Server-side rendering only"]', 0, 'conceptual', 'BEGINNER', 'React uses a Virtual DOM to optimize rendering by comparing changes and updating only what''s necessary.', 1, '2026-01-06 18:51:10.219', '2026-01-06 18:51:10.219');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (209, 13, 'What is the difference between useState and useEffect hooks?', '["useState manages state, useEffect handles side effects", "They are identical", "useEffect manages state, useState handles side effects", "Both manage state only"]', 0, 'conceptual', 'INTERMEDIATE', 'useState is for managing component state, while useEffect is for handling side effects like API calls, subscriptions, etc.', 1, '2026-01-06 18:51:10.219', '2026-01-06 18:51:10.219');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (210, 13, 'Write a React component that increments a counter when a button is clicked.', '["function Counter() { const [count, setCount] = useState(0); return (<div><p>{count}</p><button onClick={() => setCount(count + 1)}>Increment</button></div>); }", "function Counter() { let count = 0; return <button onClick={() => count++}>Increment</button>; }", "function Counter() { return <button>Increment</button>; }", "const Counter = () => count++;"]', 0, 'practical', 'INTERMEDIATE', 'The correct solution uses useState to manage the counter state and updates it with setCount when the button is clicked.', 1, '2026-01-06 18:51:10.219', '2026-01-06 18:51:10.219');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (211, 13, 'What is the purpose of the dependency array in useEffect?', '["To control when the effect runs based on value changes", "To import dependencies", "To define CSS classes", "To store component props"]', 0, 'conceptual', 'INTERMEDIATE', 'The dependency array in useEffect determines when the effect should re-run. Empty array means run once, values mean run when they change.', 1, '2026-01-06 18:51:10.219', '2026-01-06 18:51:10.219');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (212, 13, 'What is the difference between controlled and uncontrolled components?', '["Controlled components have React managing their state, uncontrolled use DOM directly", "They are identical", "Controlled components are faster", "Uncontrolled components use hooks"]', 0, 'conceptual', 'INTERMEDIATE', 'Controlled components have their value controlled by React state, while uncontrolled components use refs to access DOM directly.', 1, '2026-01-06 18:51:10.219', '2026-01-06 18:51:10.219');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (213, 13, 'Write a React component that fetches and displays data from an API using useEffect.', '["function DataDisplay() { const [data, setData] = useState(null); useEffect(() => { fetch(''/api/data'').then(r => r.json()).then(setData); }, []); return <div>{data}</div>; }", "function DataDisplay() { const data = fetch(''/api/data''); return <div>{data}</div>; }", "function DataDisplay() { return <div>Data</div>; }", "const DataDisplay = ''data'';"]', 0, 'practical', 'INTERMEDIATE', 'The correct solution uses useState to store data, useEffect to fetch it on mount (empty dependency array), and displays it.', 1, '2026-01-06 18:51:10.219', '2026-01-06 18:51:10.219');
INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (214, 13, 'What is React.memo used for?', '["To prevent unnecessary re-renders of functional components", "To create memoized values", "To manage state", "To handle events"]', 0, 'conceptual', 'INTERMEDIATE', 'React.memo is a higher-order component that memoizes a component, preventing re-renders if props haven''t changed.', 1, '2026-01-06 18:51:10.219', '2026-01-06 18:51:10.219');
