INSERT INTO public.skill_test_questions (id, course_id, question_text, options, correct_answer, question_type, difficulty, explanation, points, created_at, updated_at) VALUES (218, 13, 'Write a custom React hook that manages a toggle state.', '["function useToggle(initial = false) { const [state, setState] = useState(initial); const toggle = () => setState(!state); return [state, toggle]; }", "function useToggle() { return true; }", "function useToggle() { const state = false; return state; }", "const useToggle = () => {};"]', 0, 'practical', 'ADVANCED', 'A custom hook uses useState internally and returns both the state and a function to toggle it.', 1, '2026-01-06 18:51:10.219', '2026-01-06 18:51:10.219');
